        we distributed the annotation workload and performed continuous quality controls. Phase one and two required a small team of experts only. For phases three and four, a group of 40 dedicated annotators were assembled and supervised.
      - 'Phase 1: Data selection and preparation. Our inclusion criteria for documents were described in Section 3. A large
        effort went into ensuring that all documents are free to use. The data sources include publication repositories such
        as arXiv$^{3}$, government offices, company websites as well as data directory services for financial reports and
        patents. Scanned documents were excluded wherever possible because they can be rotated or skewed. This would not allow
        us to perform annotation with rectangular bounding-boxes and therefore complicate the annotation process.'
      - 'Phase 2: Label selection and guideline. We reviewed the collected documents and identified the most common structural
        features they exhibit. This was achieved by identifying recurrent layout elements and lead us to the definition of
        11 distinct class labels. These 11 class labels are $_{Caption}$, $_{Footnote}$, $_{Formula}$, $_{List-item}$, Page-$_{footer}$,
        $_{Page-header}$, $_{Picture}$, $_{Section-header}$, $_{Table}$, $_{Text}$, and $_{Title}$. Critical factors that
        were considered for the choice of these class labels were (1) the overall occurrence of the label, (2) the specificity
        of the label, (3) recognisability on a single page (i.e. no need for context from previous or next page) and (4) overall
        coverage of the page. Specificity ensures that the choice of label is not ambiguous, while coverage ensures that all
        meaningful items on a page can be annotated. We refrained from class labels that are very specific to a document category,
        such as Abstract in the Scientific Articles category. We also avoided class labels that are tightly linked to the
        semantics of the text. Labels such as Author and'
      - |-
        $_{Affiliation}$, as seen in DocBank, are often only distinguishable by discriminating on
        Preparation work included uploading and parsing the sourced PDF documents in the Corpus Conversion Service (CCS) [22], a cloud-native platform which provides a visual annotation interface and allows for dataset inspection and analysis. The annotation interface of CCS is shown in Figure 3. The desired balance of pages between the different document categories was achieved by selective subsampling of pages with certain desired properties. For example, we made sure to include the title page of each document and bias the remaining page selection to those with figures or tables. The latter was achieved by leveraging pre-trained object detection models from PubLayNet, which helped us estimate how many figures and tables a given page contains.
        $^{3}$https://arxiv.org/
